import React, { Component } from 'react'
import { ProductConsumer } from '../context'
import { Link } from 'react-router-dom'
import {ButtonContainer} from './Button'

export default class Details extends Component {
   render() {
      return (
         <ProductConsumer>
            {(value)=>{
               const {id, company, img, info, proce, titile, inCArt} = value.detailProduct
               return(
                  <div className="container py-5">
                     <div className="row">
                        <div className="col-10 mx-auto text-center text-slanted text-blue my-5"></div>
                     </div>
                  </div>
               )
            }}
         </ProductConsumer>
      )
   }
}
